import { useParams } from "react-router-dom";

export default function withParams(Component) {
  return props => <Component {...props} params={useParams()} />;
}

/**
 * useParams() gets the :parameter from the URL.
 *
 * It can only be used inside a function, not a React component.
 * Therefore this wrapper class lets us pass it back into our components
 * so we can maintain consistency, instead of some components
 */
